   - `content_script.js`
   - `screenshot.html`

2. Open `manifest.json` and add the following content:

```json
{
  "manifest_version": 3,
  "name": "Webpage Screenshot Extension",
  "version": "1.0",
  "action": {
    "default_popup": "screenshot.html"
  },
  "permissions": [
    "activeTab",
    "storage",
    "downloads",
    "tabs",
    "https://*/*",
    "http://*/*"
  ],
  "background": {
    "service_worker": "background.js"
  },
  "content_scripts": [
    {
      "matches": ["<all_urls>"],
      "js": ["content_script.js"]
    }
  ],
  "icons": {
    "16": "icon16.png",
    "48": "icon48.png",
    "128": "icon128.png"
  }
}
```

Replace the `icons` section with the paths to your extension's icons if you have them.

3. Open `background.js` and add the following content:

```javascript
chrome.runtime.onInstalled.addListener(function() {
  chrome.storage.local.set({ screenshotsFolder: chrome.app.getPath("LocalAppData") + "/WebpageScreenshots" });
});

chrome.runtime.onMessageFromContentScript.addListener(function(request, sender, sendResponse) {
  if (request.action === "takeScreenshot") {
    chrome.tabs.captureVisibleTab(null, {}, function(image) {
      const screenshotsFolder = chrome.storage.local.get("screenshotsFolder", {});
      const screenshotName = new Date().toISOString().replace(/:/g, "-").replace(/\./g, "-") + ".png";
      const saveAs = chrome.downloads.create({
        url: image,
        filename: screenshotName,
        saveAs: true,
        directoryId: chrome.app.getPath("LocalAppData"),
        conflictAction: "uniquify"
      });

      saveAs.onconfirmed = function(downloadId) {
        chrome.storage.local.get("screenshotsFolder", function(items) {
          const screenshotsFolder = items.screenshotsFolder;
          const screenshotsPath = screenshotsFolder + "/" + screenshotName;
          sendResponse({ success: true, screenshotPath });
        });
      };

      saveAs.onerror = function(error) {
        sendResponse({ success: false, error });
      };
    });
  }
});
